ime lapses it will be sold as the remains of currency once used by Indian sub-continent. Plus , with current growth rate India will become a super power by 2030 and thus the value of its currency will further increase as compared to dollar and holding the piece of a currency once used by a super power can be a very successful investment in a long term basis . Since , India has not yet become super power and looking at current scenario I can offer you 12 rupees for this piece of artifact. Do you choose to accept it ?'),(4149,878,'_form_id','3'),(4150,878,'_seq_num','245'),(4151,880,'_field_17','Mritunjay'),(4152,880,'_field_19','17bec0054'),(4153,880,'_field_22','9080050472'),(4154,880,'_field_23','9829788944'),(4155,880,'_field_21','mjaypathak2000@gmail.com'),(4156,880,'_field_25','through-a-friend'),(4157,880,'_field_29',''),(4158,880,'_field_26','Wanna do business in future need some experience and in the same time help you and myself to grow more'),(4159,880,'_field_27','Just one in 1st year IEEE 2nd is C.S.E.D'),(4160,880,'_field_28','Will try to change that note in RBI and then try to sell you,  if that\'s not possible than will try to convince you that you can easily change this note for same value and make offer to sell it in less than 10 ( selling price depends on how costumer responds), Try to get sympathy that I urgently need 10 rs  and exchange a new note with you'),(4161,880,'_form_id','3'),(4162,880,'_seq_num','246'),(4163,882,'_field_17','Rishabh singhvi'),(4164,882,'_field_19','17BCE0226'),(4165,882,'_field_22','9079835899'),(4166,882,'_field_23','7597466660'),(4167,882,'_field_21','rishabhsinghvi9@gmail.com'),(4168,882,'_field_25','through-a-friend'),(4169,882,'_field_29',''),(4170,882,'_field_26','To improve my technical and managment works'),(4171,882,'_field_27','1. IE(I)'),(4172,882,'_field_28','Bank refund the torn  note '),(4173,882,'_form_id','3'),(4174,882,'_seq_num','247'),(4175,884,'_field_17','Kunal'),(4176,884,'_field_19','18BCI0189'),(41