all the things that make your business unique and better than the competition. Do you have a patented 13-step process for taxidermy that results in the most lifelike stuffed owls? You gotta mention that.</p>\r\n<p>Other good things to weave into this copy include: awards won, distinctions given, number of products sold, company philosophy (just keep it short), interesting company history bits, and anything that makes a reader think you\'d be awesome to do business with.</p>\r\n				<img src=\"http://recruit.csedvit.com/wp-content/uploads/2018/10/home-4.jpg\" alt=\"home-4\" itemprop=\"image\"  />\r\n		<h3>Next Steps...</h3>\r\n		<p>This is should be a prospective customer\'s number one call to action, e.g., requesting a quote or perusing your product catalog.</p>\r\n	<a href=\"\" target=\"_self\" role=\"button\">\r\n						Call to Action\r\n					</a>\r\n','Home','','inherit','closed','closed','','156-revision-v1','','','2018-11-11 18:55:36','2018-11-11 18:55:36','',156,'http://recruit.csedvit.com/156-revision-v1/',0,'revision','',0),(924,0,'2018-12-13 10:29:46','2018-12-13 10:29:46','','','','publish','closed','closed','','924','','','2018-12-13 10:29:46','2018-12-13 10:29:46','',0,'http://recruit.csedvit.com/nf_sub/924/',0,'nf_sub','',0),(925,0,'2018-12-13 10:29:46','2018-12-13 10:29:46','[]','tabletrtdvalign=topName/tdtdNALANAGULAHARSHAVARDANKAMAL/td/trtrtdvalign=topRegistrationNumber/tdtd18BCE0983/td/trtrtdvalign=topPhoneNumberCalling/tdtd9003848624/td/trtrtdvalign=topPhoneNumberWhatsApp/tdtd9003848624/td/trtrtdvalign=topEmail-ID/tdtdnharshavardan.kamal2018@vitstudent.ac.intdtrtrtdvaligntopHowdidyougettoknowaboutCSEDtdtdtdtrtrtdvaligntopOtherstdtdtdtrtrtdvaligntopWhydoyouwishtojoinCSEDtdtdnharshavardan.kamal2018vitstudent.ac.intdtrtrtdvaligntopHowmanyotherclubshaveyouinterviewedforNamethemEx21.ABC2.XYZtdtdrotaractclubtdtrtrtdvaligntopHowwillyousellonepartofafullytorn10rupeenotetoustdtdiwouldrepairthenotebygivingittothebankandsellittdtrtable','','request-pending','cl